## 在特徵視圖中列出同步操作
使用以下示例可查看針對某個特徵視圖執行的所有同步操作的列表。
如需查看 [FeatureView](https://cloud.google.com/vertex-ai/docs/reference/rest/v1beta1/projects.locations.featureOnlineStores.featureViews?hl=zh-cn#resource:-featureView) 實例中的數據同步操作列表，請使用 [featureViewSyncs.list](https://cloud.google.com/vertex-ai/docs/reference/rest/v1beta1/projects.locations.featureOnlineStores.featureViews.featureViewSyncs/list?hl=zh-cn) 方法發送 `GET` 請求。
在使用任何請求數據之前，請先進行以下替換：- ：在線存儲區所在的區域，例如`us-central1`。
- ：您的項目 ID。
- ：包含特徵視圖的在線存儲區的名稱。
- ：要查看其數據同步操作列表的特徵視圖的名稱。
HTTP 方法和網址：
```
GET https://LOCATION_ID-aiplatform.googleapis.com/v1beta1/projects/PROJECT_ID/locations/LOCATION_ID/featureOnlineStores/FEATUREONLINESTORE_NAME/featureViews/FEATUREVIEW_NAME/featureViewSyncs
```
如需發送請求，請選擇以下方式之一：
 **注意** ：以下命令假定您已使用您的用戶賬號通過運行 [gcloud init](https://cloud.google.com/sdk/gcloud/reference/init?hl=zh-cn) 或 [gcloud auth login](https://cloud.google.com/sdk/gcloud/reference/auth/login?hl=zh-cn) 登錄`gcloud`CLI，或者使用了 [Cloud Shell](https://cloud.google.com/shell/docs?hl=zh-cn) ，這會使您自動登錄`gcloud`CLI。您可以運行 [gcloud auth list](https://cloud.google.com/sdk/gcloud/reference/auth/list?hl=zh-cn) 來檢查當前活躍的賬號。
執行以下命令：
```
curl -X GET \ -H "Authorization: Bearer $(gcloud auth print-access-token)" \ "https://LOCATION_ID-aiplatform.googleapis.com/v1beta1/projects/PROJECT_ID/locations/LOCATION_ID/featureOnlineStores/FEATUREONLINESTORE_NAME/featureViews/FEATUREVIEW_NAME/featureViewSyncs"
``` **注意** ：以下命令假定您已使用您的用戶賬號通過運行 [gcloud init](https://cloud.google.com/sdk/gcloud/reference/init?hl=zh-cn) 或 [gcloud auth login](https://cloud.google.com/sdk/gcloud/reference/auth/login?hl=zh-cn) 登錄`gcloud`CLI，或者使用了 [Cloud Shell](https://cloud.google.com/shell/docs?hl=zh-cn) ，這會使您自動登錄`gcloud`CLI。您可以運行 [gcloud auth list](https://cloud.google.com/sdk/gcloud/reference/auth/list?hl=zh-cn) 來檢查當前活躍的賬號。
執行以下命令：
```
$cred = gcloud auth print-access-token$headers = @{ "Authorization" = "Bearer $cred" }Invoke-WebRequest ` -Method GET ` -Headers $headers ` -Uri "https://LOCATION_ID-aiplatform.googleapis.com/v1beta1/projects/PROJECT_ID/locations/LOCATION_ID/featureOnlineStores/FEATUREONLINESTORE_NAME/featureViews/FEATUREVIEW_NAME/featureViewSyncs" | Select-Object -Expand Content
```
